import React,{useState} from "react";
import { Nav } from "rsuite";

const LeftNav = () => {
  const contentStyles = {
      width: "10rem",
      height: "95vh",
      marginLeft: "0.5rem"
  };

  const NavContents = ({active, onSelect, ...props}) => {
    return (
      <Nav {...props} vertical activeKey={active} onSelect={onSelect} style={contentStyles}>
        <Nav.Item style={{marginTop:"1rem"}} eventKey="home">Home</Nav.Item>
        <Nav.Item eventKey="projectOne">Project One</Nav.Item>
        <Nav.Item eventKey="projectTwo">Project Two</Nav.Item>
      </Nav>
    );
  };

  const [active, setActive] = useState("projectOne")
  const handleSelect = (active) => {
    setActive(active)
  }

  return <NavContents  appearance="tabs" active={active} onSelect={handleSelect}/>;
};

export default LeftNav;
